import React from 'react';
import { Link } from 'react-router-dom';

const Projects = () => {
    return ( 
        <div>
            <div className="buttonContainer">
                <Link to="/">
                    <button className="exit">X</button>
                </Link>
            </div>  

            <p className="about">Test:</p>
        </div>
     );
}
 
export default Projects;
